<style scoped>
html.light svg {
  --colors-logo-outer-text: var(--color-brand-alternate);
  --colors-logo-inner-text: var(--color-brand-primary);
  --colors-logo-cleavers: var(--color-brand-dark);
}

html.dark svg {
  --colors-logo-outer-text: var(--color-brand-alternate);
  --colors-logo-inner-text: var(--color-brand-primary);
  --colors-logo-cleavers: var(--color-olive-300);
}
.logo-outer-text {
  transform-origin: center;
  animation: rotate-counter-clockwise 40s linear infinite;
}

.logo-inner-text {
  transform-origin: center;
  animation: rotate-clockwise 45s linear infinite;
}

@keyframes rotate-clockwise {
  from { transform: rotate(0deg); }
  to { transform: rotate(360deg); }
}

@keyframes rotate-counter-clockwise {
  from { transform: rotate(0deg); }
  to { transform: rotate(-360deg); }
}
</style>